import React from 'react';

const About = () => {
    return (
        <div
            style={{
                textAlign: 'center',
                height: '100vh',
                width: '70vw',
                paddingTop: '100px',
                margin: '0 auto'
            }}
        >
            <h1>Acest site a fost creat ca un proiect de studiu pentru cursul de tehnologii web. El are functia de afisare si cautare a 100 celor mai populare cryptocurrency si afisarea lor in timp real a cursului valutar.</h1>
        </div>
    );
};

export default About;
